const PREVIEW_LOOKUP = {"0":{"t":"Monitoring network services (Active checks) - Monitoring of HTTPS, TCP, SSH, FTP and further services","p":"For many services, it only makes sense to externally monitor them for function or response times. Here you will learn how this works in Checkmk.","l":"active_checks.html"},"1":{"t":"Automatic agent updates - Distribute agents and plug-ins automatically","p":"In this article you will learn how to create custom installation packages for agents, and if required, distribute them automatically.","l":"agent_deployment.html"},"2":{"t":"Monitoring FreeBSD - The agent for FreeBSD in detail","p":"The FreeBSD agent is a simple shell script and therefore maximally transparent. How to use, extend and configure the agent can be found here.","l":"agent_freebsd.html"},"3":{"t":"Monitoring Linux - The new agent for Linux in detail","p":"The Linux agent of Checkmk version 2.1.0 adds the Agent Controller and new features to the agent script. You can learn how to use the agent here.","l":"agent_linux.html"},"4":{"t":"Monitoring Linux in legacy mode","p":"The Linux agent can be run in legacy mode without an Agent Controller if it does not meet the requirements for the encrypted pull mode.","l":"agent_linux_legacy.html"},"5":{"t":"Monitoring Windows - The new agent for Windows in detail","p":"The Windows agent of Checkmk version 2.1.0 adds the Agent Controller and new features to the agent program. You can learn how to use the agent here.","l":"agent_windows.html"},"6":{"t":"Alert handlers - Responding to problems automatically","p":"Some problems occur only rarely and with a short duration. Checkmk can then run alert handler scripts to collect information for analysis.","l":"alert_handlers.html"},"7":{"t":"Analyzing the Checkmk site configuration","p":"Analyze configuration allows you to check the site of the Checkmk server for performance, security, processor utilization and more.","l":"analyze_configuration.html"},"8":{"t":"Overview of API resources","p":"Checkmk offers several APIs as well as related articles and references. Here you will find an overview and tips for navigation.","l":"apis_intro.html"},"9":{"t":"Backup in the appliance","p":"Instructions for creating and restoring backups in the appliance.","l":"appliance_backup.html"},"10":{"t":"Appliance in cluster operation","p":"Setting up a failover cluster.","l":"appliance_cluster.html"},"11":{"t":"Installation of the virtual appliance","p":"The virtual appliance makes Checkmk even easier to set up. Installation is done by importing into VirtualBox, Proxmox or VMware ESXi.","l":"appliance_install_virt1.html"},"12":{"t":"Quick start guide for Checkmk racks","p":"Quick start guide for the Checkmk physical appliance setup.","l":"appliance_rack1_quick_start.html"},"13":{"t":"Special features of the hardware appliance","p":"Guidance on specific aspects of the physical appliance.","l":"appliance_rack_config.html"},"14":{"t":"Configuring and using the appliance","p":"Instructions for setting up the physical and virtual Checkmk appliances.","l":"appliance_usage.html"},"15":{"t":"Quick start guide for Checkmk virt1","p":"Quick start guide for the Checkmk virtual appliance setup.","l":"appliance_virt1_quick_start.html"},"16":{"t":"Availability - Evaluating and analyzing availabilities","p":"Checkmk calculates the availability of an object as needed since it is known to it. Learn all about how to use reports here.","l":"availability.html"},"17":{"t":"Backups - Backing up and restoring data","p":"In this article you will learn how to back up the data for a Checkmk site and also restore it.","l":"backup.html"},"18":{"t":"The Bakery API","p":"The Bakery API provides an interface for extending agent packages in the Agent Bakery, e.g. with agent plug-ins and their configuration.","l":"bakery_api.html"},"19":{"t":"Acknowledging problems - Distinguishing new problems from those in progress","p":"Problems are rarely fixed as soon as they are detected. Learn here how to acknowledge problems in Checkmk and how to find acknowledgments in the GUI.","l":"basics_ackn.html"},"20":{"t":"Scheduled downtimes","p":"Scheduled downtimes must be taken into account in monitoring. How scheduled downtimes can be mapped in Checkmk can be found here.","l":"basics_downtimes.html"},"21":{"t":"Business Intelligence (BI) - Reduce complexity with BI","p":"Complex relationships can be easily visualized with Business Intelligence (BI). Learn step by step how to build BIs - rule-based and dynamically.","l":"bi.html"},"22":{"t":"Checkmk Cloud","p":"What makes Checkmk Cloud special, especially in comparison to the other Checkmk editions, can be found here.","l":"cce.html"},"23":{"t":"Monitoring cluster services","p":"Checkmk helps you set up a cluster for a group of networked hosts with the same task and select the cluster services for monitoring.","l":"clustered_services.html"},"24":{"t":"The Checkmk Micro Core (CMC)","p":"Learn all about the specific Checkmk Micro Core (CMC) and its advantages in this article.","l":"cmc.html"},"25":{"t":"Special characteristics of the CMC","p":"The Checkmk Micro Core (CMC) differs in some details from other Nagios-compatible cores. These are described in detail here.","l":"cmc_differences.html"},"26":{"t":"CMC files and directories","p":"This overview shows all of the important files and directories relating to the Checkmk Micro Core (CMC).","l":"cmc_files.html"},"27":{"t":"Migration to the CMC - Switching from Nagios to the Checkmk Micro Core","p":"Everything you need to know for a migration from the Nagios core to the Checkmk Micro Core (CMC) is contained in this article.","l":"cmc_migration.html"},"28":{"t":"Checkmk on the command line - Understanding and using command line commands","p":"If you want to use Checkmk on the command line, here you will find the most important commands (e.g. cmk) and the associated files and directories.","l":"cmk_commandline.html"},"29":{"t":"Checkmk versions","p":"The Checkmk software development leads from daily builds, innovation versions, beta versions to the stable version - for which there is active and passive support.","l":"cmk_versions.html"},"30":{"t":"Commands","p":"Learn here how to use Checkmk in monitoring to perform specific actions on hosts or services by command.","l":"commands.html"},"31":{"t":"Copyright information","p":"Notes to the rights of texts and graphics in the Checkmk User guide","l":"copyright.html"},"32":{"t":"Checkmk Enterprise","p":"The different Checkmk editions offer different feature sets. This article explains the Checkmk Enterprise.","l":"cse.html"},"33":{"t":"Custom notes - about hosts and services","p":"In the views for hosts and services you can provide custom notes. In this article we will show you, how to set this up in Checkmk.","l":"custom_notes.html"},"34":{"t":"Dashboards","p":"Checkmk dashboards are extremely flexible and they automatically adapt to the available space. Read here how to interpret and create dashboards.","l":"dashboards.html"},"35":{"t":"Datasource programs - Monitoring devices without access to an operating system","p":"Datasource programs monitor hosts that are reachable only through an API. Basic information about this function is provided here.","l":"datasource_programs.html"},"36":{"t":"Dynamic host configuration - Managing dynamic infrastructures","p":"Checkmk can manage volatile infrastructures by dynamically adding and deleting hosts in a fully-automated procedure.","l":"dcd.html"},"37":{"t":"Guidelines for coding check plug-ins","p":"Check plug-ins that are to be included in the official Checkmk software must fulfil certain requirements, which you can find here.","l":"dev_guidelines.html"},"38":{"t":"Writing agent-based check plug-ins","p":"Here you can find out how to develop agent-based Checkmk plug-ins - with everything that this involves, especially with the newly developed Check API in version 2.0.0.","l":"devel_check_plugins.html"},"39":{"t":"Writing SNMP-based check plug-ins","p":"Learn how to develop check plug-ins for SNMP using the Check API and use them in Checkmk.","l":"devel_check_plugins_snmp.html"},"40":{"t":"Developing extensions for Checkmk","p":"Here you will learn which methods and programming languages you can use to develop extensions for Checkmk.","l":"devel_intro.html"},"41":{"t":"Distributed monitoring - Scaling and distributing Checkmk","p":"Here you will learn how to set up a distributed monitoring with a central site and several remote sites using Checkmk.","l":"distributed_monitoring.html"},"42":{"t":"The Event Console - Processing logs and SNMP traps","p":"Whether syslog, forwarded text logs or traps via SNMP - here you will learn how to process these events in the Checkmk Event Console.","l":"ec.html"},"43":{"t":"Forecast graphs","p":"Improve your capacity management with the Checkmk forecast graphs. Details on how to configure these can be found here.","l":"forecast_graphs.html"},"44":{"t":"Glossary","p":"The glossary with the most important Checkmk-specific terms.","l":"glossar.html"},"45":{"t":"Integrating Checkmk in Grafana","p":"Easily create Grafana dashboards with data from your Checkmk monitoring with the Checkmk plug-in for Grafana.","l":"grafana.html"},"46":{"t":"Measured values and graphing - Evaluating measured values in Checkmk quickly and easily","p":"Checkmk provides many comprehensive metrics to represent, combine and export. Important background knowledge can be found at the end of the article.","l":"graphing.html"},"47":{"t":"Host tags","p":"With host tags, host tag groups and auxiliary tags you can structure folders and hosts according to your wishes.","l":"host_tags.html"},"48":{"t":"Automated host creation","p":"Checkmk site and agent can be prepared to create hosts automatically. This article describes how to set this up.","l":"hosts_autoregister.html"},"49":{"t":"Host administration - Managing systems being monitored","p":"Here you will learn about the options Checkmk provides for creating hosts, structuring them with folders and for maintaining them.","l":"hosts_setup.html"},"50":{"t":"Host structuring","p":"Scalability is part of the basic Checkmk design. You can learn about the options for structuring hosts here.","l":"hosts_structure.html"},"51":{"t":"The official Checkmk User Guide","p":"The Checkmk User Guide helps you to get started with Checkmk and helps advanced users to get the best our of their monitoring.","l":"index.html"},"52":{"t":"Installation of Checkmk in the appliance","p":"Instructions for installing Checkmk in the virtual and physical appliance","l":"install_appliance_cmk.html"},"53":{"t":"Installation from AWS Marketplace","p":"Checkmk provides an (almost) turnkey image in the AWS Marketplace. In this article, you will learn how to complete the setup.","l":"install_aws.html"},"54":{"t":"Installation from Azure Marketplace","p":"Checkmk provides an (almost) turnkey image in the Azure Marketplace. In this article, you will learn how to complete the setup.","l":"install_azure.html"},"55":{"t":"Basic information on the installation of Checkmk","p":"Each Linux distribution (RHEL-based, SLES, Debian and Ubuntu) has its own special features which need to be considered when installing Checkmk.","l":"install_packages.html"},"56":{"t":"Installation on Debian and Ubuntu","p":"Learn how to install Checkmk on the Linux distribution of Debian and of Ubuntu.","l":"install_packages_debian.html"},"57":{"t":"Installation on Red Hat and derivatives","p":"Learn how to install Checkmk on the Linux distribution of Red Hat Enterprise Linux (RHEL) and its derivatives.","l":"install_packages_redhat.html"},"58":{"t":"Installation on SUSE Linux Enterprise Server","p":"Learn how to install Checkmk on the Linux distribution of SUSE Linux Enterprise Server (SLES).","l":"install_packages_sles.html"},"59":{"t":"Integrating Datadog","p":"Monitors and events from Datadog can be integrated into Checkmk.","l":"integrating_datadog.html"},"60":{"t":"Best practices, tips & tricks","p":"Best practices can help you avoid problems in Checkmk, e.g. when monitoring Windows services, the internet connection or HTTP/HTTPS services.","l":"intro_bestpractise.html"},"61":{"t":"Extending the monitoring system further","p":"Examples to expand monitoring with Checkmk after setup are: optimizing security, monitoring very large environments and using Business Intelligence (BI).","l":"intro_extend.html"},"62":{"t":"Fine-tuning the monitoring","p":"Rules and host tags are important and powerful tools for configuration and to avoid  a whole range of false alarms in Checkmk.","l":"intro_finetune.html"},"63":{"t":"The Checkmk user interface","p":"Important components of the graphical user interface (GUI) of Checkmk are the navigation bar, main page and sidebar.","l":"intro_gui.html"},"64":{"t":"Checkmk in monitoring","p":"Acknowledging problems and setting up scheduled downtimes are important tasks in monitoring with Checkmk.","l":"intro_monitor.html"},"65":{"t":"Switching on notifications","p":"For the notifications in Checkmk, their dispatch by email has to be prepared and activated. Next, the notification is tested.","l":"intro_notifications.html"},"66":{"t":"Setting up Checkmk","p":"Setting up Checkmk involves selecting the appropriate edition and version, installing the software, creating a site, and logging in for the first time.","l":"intro_setup.html"},"67":{"t":"Setting up monitoring","p":"To set up Checkmk for monitoring, the first host must be included, its services configured and the changes activated.","l":"intro_setup_monitor.html"},"68":{"t":"The monitoring tools","p":"Important tools for monitoring with Checkmk are the snap-ins of the sidebar, such as Overview and Master control, and the Monitor menu.","l":"intro_tools.html"},"69":{"t":"Working with multiple users","p":"A user's scope of responsibility is defined in Checkmk by assigning roles for permissions and contact groups for responsibilities.","l":"intro_users.html"},"70":{"t":"Installation as a Docker container","p":"Installing Checkmk in a Docker container is very easy with the official image. The relevant options are described in more detail here.","l":"introduction_docker.html"},"71":{"t":"The HW/SW Inventory","p":"Use the HW/SW Inventory to identify the hardware equipment, installed software and more on the hosts monitored by Checkmk.","l":"inventory.html"},"72":{"t":"Single sign-on with Kerberos","p":"Single sign-on (SSO) is not an official feature of Checkmk, however this article will show you how to integrate SSO with Kerberos into Checkmk.","l":"kerberos.html"},"73":{"t":"Labels","p":"In this article you will learn how to use familiar structuring markers from other environments in Checkmk by using host and service labels.","l":"labels.html"},"74":{"t":"User management with LDAP/Active Directory","p":"In Checkmk users and contact groups can also be synchronized via LDAP or Microsoft's Active Directory (AD).","l":"ldap.html"},"75":{"t":"Managing licenses - collect and send license information","p":"In this article you will learn how to handle the licensing of the software in Checkmk and how to collect and transmit information about the current licence state.","l":"license.html"},"76":{"t":"Retrieving status data via Livestatus","p":"Livestatus is the interface to directly access all data of the monitored objects. This article introduces the use of the API.","l":"livestatus.html"},"77":{"t":"Livestatus command reference","p":"The Livestatus reference contains tables, filters and operators for lookup and thus complements the introductory article on the Livestatus API.","l":"livestatus_references.html"},"78":{"t":"Local checks","p":"Checkmk can be easily extended even without much programming knowledge. Find out here how to provide your own script to an agent.","l":"localchecks.html"},"79":{"t":"Checkmk Managed Services - Offering Checkmk as a service","p":"With the Checkmk Managed Services you can operate separate sites for several customers via distributed monitoring.","l":"managed.html"},"80":{"t":"Checkmk server in a Docker container","p":"Following the start of a Docker container is its ongoing maintenance. This article describes what peculiarities should be noted.","l":"managing_docker.html"},"81":{"t":"Sending metrics to InfluxDB and Graphite - via InfluxDB v2 API or Carbon plaintext protocol","p":"Metrics stored in Checkmk can be sent to InfluxDB and Graphite metric databases for further processing.","l":"metrics_exporter.html"},"82":{"t":"Monitoring files","p":"In Checkmk you can use mk_filestats and fileinfo to monitor files for age, size and count, both on Linux and Windows.","l":"mk_filestats.html"},"83":{"t":"MKPs for GUI extensions - Checkmk extensions packages for dashboards, views, reports","p":"Dashboards, views and reports can be easily packaged and shared with others - even via the Checkmk Exchange.","l":"mkp_viewables.html"},"84":{"t":"Checkmk extension packages (MKPs) - Integrating extensions from the community into Checkmk","p":"Extensions created by the Checkmk community can be easily packaged and then shared with others.","l":"mkps.html"},"85":{"t":"Monitoring Amazon Web Services (AWS)","p":"How to monitor and seamlessly integrate Amazon S3, EC2, EBS, RDS and ELB or their costs into Checkmk without an agent is described here.","l":"monitoring_aws.html"},"86":{"t":"Monitoring Microsoft Azure","p":"The integration of Microsoft Azure into Checkmk enables seamless monitoring of cloud and on-premises in one interface and is described in detail here.","l":"monitoring_azure.html"},"87":{"t":"Basic principles of monitoring with Checkmk - Understanding Checkmk terms","p":"This article explains basic terms and concepts in Checkmk, such as host, service, user, contact group, notification, time period, scheduled downtime.","l":"monitoring_basics.html"},"88":{"t":"Monitoring Docker","p":"This article describes how to run a complete monitoring of Docker nodes and their containers in Checkmk and what you need to be aware of.","l":"monitoring_docker.html"},"89":{"t":"Monitoring Google Cloud Platform (GCP)","p":"How to monitor and seamlessly integrate Google Cloud Run, Cloud SQL, Cloud Functions, GCE, GCS and Memorystore/Redis or their costs into Checkmk without an agent is described here.","l":"monitoring_gcp.html"},"90":{"t":"Monitoring time-based processes (Cronjobs)","p":"Learn how to monitor the correct and successful execution of time-based processes - cronjobs - with Checkmk.","l":"monitoring_jobs.html"},"91":{"t":"Monitoring Kubernetes","p":"With Checkmk you can also monitor the Kubernetes container orchestration software. Read details on this agentless facility here.","l":"monitoring_kubernetes.html"},"92":{"t":"Monitoring log files","p":"In Checkmk you can monitor log files using the agent plug-in logwatch.","l":"monitoring_logfiles.html"},"93":{"t":"Monitoring Microsoft SQL Server","p":"With the Checkmk plug-in for Windows and Linux you can fully monitor Microsoft SQL Server.","l":"monitoring_mssql.html"},"94":{"t":"Monitoring MSSQL with the legacy plug-in","p":"With the legacy plug-in `mssql.vbs` for Windows you can monitor Microsoft SQL Server.","l":"monitoring_mssql_legacy.html"},"95":{"t":"Monitoring MySQL","p":"With the Checkmk plug-in for Windows, Linux, Solaris and AIX you can fully monitor MySQL.","l":"monitoring_mysql.html"},"96":{"t":"Monitoring OpenShift","p":"You can also use Checkmk to monitor the OpenShift container platform. Read the setup details here.","l":"monitoring_openshift.html"},"97":{"t":"Monitoring Oracle databases","p":"With the agent plug-in for Windows, Linux, Solaris and AIX you can fully monitor Oracle databases. Details about the configuration can be found here.","l":"monitoring_oracle.html"},"98":{"t":"Integrating Prometheus","p":"Prometheus can be integrated into Checkmk to monitor fast-moving container environments.","l":"monitoring_prometheus.html"},"99":{"t":"Monitoring VMware ESXi","p":"With Checkmk you can monitor a vCenter, its ESXi hosts and also the virtual machines (VMs) without requiring extra agents.","l":"monitoring_vmware.html"},"100":{"t":"Connecting Nagstamon to Checkmk","p":"Nagstamon is a tool which enables administrators to immediately see problems on the desktop without a browser. These instructions help with the connection to Checkmk.","l":"nagstamon.html"},"101":{"t":"NagVis: status data on maps and diagrams","p":"The NagVis open-source tool is an integral part of Checkmk. This article provides an ideal introduction to NagVis and its integration into Checkmk.","l":"nagvis.html"},"102":{"t":"Network visualization","p":"Checkmk now has a backend for the visualization of network topologies. In this article we show you, how to use this feature.","l":"network_topology.html"},"103":{"t":"Notifications - via Email, SMS, ticket system and more","p":"To configure notifications, the time, method and group of recipients are essential. Learn here how to implement your requirements in Checkmk.","l":"notifications.html"},"104":{"t":"Notifications via ilert","p":"You can have Checkmk send notifications to the ilert platform. Find out here how to connect.","l":"notifications_ilert.html"},"105":{"t":"Notifications via Jira","p":"You can have Checkmk send notifications to Jira to create and close Jira issues. Find out here how to connect.","l":"notifications_jira.html"},"106":{"t":"Notifications via Mattermost","p":"You can have Checkmk send notifications to the open-source instant messaging service Mattermost. Find out here how to connect.","l":"notifications_mattermost.html"},"107":{"t":"Notifications via Opsgenie","p":"You can have Checkmk send notifications to the incident management platform Opsgenie. Find out here how to connect.","l":"notifications_opsgenie.html"},"108":{"t":"Notifications via PagerDuty","p":"You can have Checkmk send notifications to the incident management platform PagerDuty. Find out here how to connect.","l":"notifications_pagerduty.html"},"109":{"t":"Notifications via Pushover","p":"You can have Checkmk send notifications to Apple and Android mobile devices via the Pushover service. Find out here how to connect.","l":"notifications_pushover.html"},"110":{"t":"Notifications via ServiceNow","p":"You can have Checkmk send notifications to the incident management system ServiceNow. Find out here how to connect.","l":"notifications_servicenow.html"},"111":{"t":"Notifications via SIGNL4","p":"You can have Checkmk send notifications to the SIGNL4 alerting software. Find out here how to connect.","l":"notifications_signl4.html"},"112":{"t":"Notifications via Slack","p":"You can have Checkmk send notifications to the instant messaging service Slack. Find out here how to connect.","l":"notifications_slack.html"},"113":{"t":"Notifications via Splunk On-Call","p":"You can have Checkmk send notifications to the incident management platform Splunk On-Call. Find out here how to connect.","l":"notifications_splunkoncall.html"},"114":{"t":"Notifications via Microsoft Teams","p":"You can have Checkmk send notifications to Microsoft Teams channels. Find out here how to connect.","l":"notifications_teams.html"},"115":{"t":"Notifications via Cisco Webex Teams","p":"You can have Checkmk send notifications to Cisco Webex Teams. Find out here how to connect.","l":"notifications_webex.html"},"116":{"t":"Integrating ntopng in Checkmk - Connect Checkmk to an ntop solution","p":"With the integration of ntopng, you extend the functions of Checkmk with the monitoring of the network data flows and the deep analysis of the network traffic.","l":"ntop.html"},"117":{"t":"Site administration with omd","p":"Checkmk enables the administration of any number of monitoring sites and software versions on a server with the omd command.","l":"omd_basics.html"},"118":{"t":"Securing the web interface with HTTPS","p":"For security reasons, web interfaces should only be operated over HTTPS. Learn how to enable encryption for a Checkmk site.","l":"omd_https.html"},"119":{"t":"Password store","p":"This article shows how you can store passwords for accessing remote systems in the Checkmk password store and use them from there.","l":"password_store.html"},"120":{"t":"The piggyback mechanism","p":"Here you will learn how to piggyback monitoring data from a host when querying another host using Checkmk.","l":"piggyback.html"},"121":{"t":"Ports - Ports used by Checkmk","p":"Checkmk uses some ports for communication which must be enabled. You can find out what these are here.","l":"ports.html"},"122":{"t":"Predictive monitoring","p":"Predictive monitoring calculates a prediction of how a service in Checkmk will behave in the future based on measurement data from the past.","l":"predictive_monitoring.html"},"123":{"t":"Regular expressions in Checkmk - Configuring Checkmk with text templates","p":"In Checkmk, you can use regular expressions in many places to capture a group of objects and thus achieve a highly-dynamic operational environment.","l":"regexes.html"},"124":{"t":"Release notes - for Checkmk 2.3.0","p":"Checkmk 2.3.0 works with a range of platforms and integrations supported during the product lifecycle's active maintenance.","l":"release_notes.html"},"125":{"t":"Linux upgrade on the Checkmk server","p":"What to consider when release upgrading the Linux distribution on the Checkmk server, you will learn in this article.","l":"release_upgrade.html"},"126":{"t":"Reports","p":"Checkmk can not only generate reports automatically/ad hoc, but also send them directly. Learn how to use this feature here.","l":"reporting.html"},"127":{"t":"The Checkmk REST API","p":"With the Checkmk REST API, tasks that you would otherwise perform using the GUI can be executed by the Checkmk server via HTTP requests.","l":"rest_api.html"},"128":{"t":"Checkmk Synthetic Monitoring with Robotmk","p":"Checkmk Synthetic Monitoring integrates software testing based on Robot Framework into your monitoring.","l":"robotmk.html"},"129":{"t":"Authentication with SAML","p":"Checkmk can be incooperated in single sign-on (SSO) solutions. Read here how to set up authentication with SAML.","l":"saml.html"},"130":{"t":"Searching docs.checkmk.com - Getting the most out of Search","p":"docs.checkmk.com uses a Lunr-based search, which is fast and offers many configuration options. You can learn about these options here.","l":"search.html"},"131":{"t":"Security - Additional safeguarding for Checkmk","p":"Checkmk is already very safe by design. This article describes what you can do to make your monitoring even more secure.","l":"security.html"},"132":{"t":"Simulation mode - Simulating data in Checkmk","p":"To test Checkmk without network access, you can simulate operation with data from the cache. How this works is described here.","l":"simulation_mode.html"},"133":{"t":"Extended availability (SLAs) - Configuring and evaluating SLAs","p":"Service level agreements (SLAs) are often not displayable as simple availability. This article explains how to configure and use complex SLAs.","l":"sla.html"},"134":{"t":"Monitoring via SNMP - Monitoring of SNMP devices with Checkmk","p":"Checkmk flexibly supports you in monitoring all possible devices with SNMP. Here is how SNMP works and how it works with CMK.","l":"snmp.html"},"135":{"t":"The spool directory - Adding file contents to agent outputs","p":"The spool directory can be used by regularly running programs to store information about their state, which is then added to the agent's output.","l":"spool_directory.html"},"136":{"t":"Support diagnostics - Collect diagnostic information","p":"You can select and collect diagnostic information in a central location and later send this dump to Checkmk support for error analysis.","l":"support_diagnostics.html"},"137":{"t":"Time periods - Restricting actions to specific times of the day","p":"Here you will learn how to use time periods to map common restrictions such as working or service hours.","l":"timeperiods.html"},"138":{"t":"Updates and Upgrades","p":"No matter whether Raw or one of the commercial editions: updating Checkmk is as simple as possible. The principles are explained here.","l":"update.html"},"139":{"t":"Update to version 2.3.0","p":"In this article you will learn what to consider when updating from Checkmk version 2.2.0 to 2.3.0.","l":"update_major.html"},"140":{"t":"Update matrix for version 2.3.0","p":"This article shows the Linux distribution versions supported by Checkmk. This will help you determine the order to update Checkmk on your Linux server.","l":"update_matrix.html"},"141":{"t":"The user interface","p":"After the first login you land on the Checkmk start page. The most important elements are explained here: navigation bar, main page, side bar.","l":"user_interface.html"},"142":{"t":"Host and service views","p":"Views are very powerful in Checkmk and can be individually created or customized. How to effectively use views is explained here.","l":"views.html"},"143":{"t":"Configuring Checkmk","p":"Checkmk enables the entire basic configuration directly in the web interface. This article offers a first introduction to the configuration environment.","l":"wato.html"},"144":{"t":"Monitoring agents - Monitoring devices in a network with Checkmk","p":"Here you will get a quick overview of how to monitor servers, switches, and other devices - and how the agent works.","l":"wato_monitoringagents.html"},"145":{"t":"Rules","p":"Rules in Checkmk can define the default or the exception. This article describes the use of rules in detail, and how they are evaluated.","l":"wato_rules.html"},"146":{"t":"Understanding and configuring services - Detecting and monitoring elements of a host","p":"Services form the core of every monitored host. They are automatically recorded and can be extensively configured and structured.","l":"wato_services.html"},"147":{"t":"Users, roles and permissions - User and authorization configuration","p":"Each monitored object has a responsible person. Here you can learn what roles and contact groups are, and everything else important to user management.","l":"wato_user.html"},"148":{"t":"Welcome to the Checkmk User Guide","p":"Each manual requires a specific usage. Here we explain how the Checkmk User Guide is structured so that you can quickly find the relevant content.","l":"welcome.html"}};